CREATE DATABASE online_store;
USE online_store;

CREATE TABLE IF NOT EXISTS `django_migrations` (`id` integer NOT NULL PRIMARY KEY , `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group_permissions` (`id` integer NOT NULL PRIMARY KEY , `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) , `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) );
CREATE TABLE IF NOT EXISTS `auth_user_groups` (`id` integer NOT NULL PRIMARY KEY , `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) , `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) );
CREATE TABLE IF NOT EXISTS `auth_user_user_permissions` (`id` integer NOT NULL PRIMARY KEY , `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) , `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) );
CREATE TABLE IF NOT EXISTS `django_admin_log` (`id` integer NOT NULL PRIMARY KEY , `action_time` datetime NOT NULL, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `change_message` text NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`) , `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) , `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0));
CREATE TABLE IF NOT EXISTS `django_content_type` (`id` integer NOT NULL PRIMARY KEY , `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_permission` (`id` integer NOT NULL PRIMARY KEY , `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`) , `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_user` (`id` integer NOT NULL PRIMARY KEY , `password` varchar(128) NOT NULL, `last_login` datetime NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `first_name` varchar(30) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `last_name` varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group` (`id` integer NOT NULL PRIMARY KEY , `name` varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `orders_status` (`id` integer NOT NULL PRIMARY KEY , `is_active` bool NOT NULL, `created` datetime NOT NULL, `updated` datetime NOT NULL, `name` varchar(24) NULL);
CREATE TABLE IF NOT EXISTS `orders_productinorder` (`id` integer NOT NULL PRIMARY KEY , `status` bool NOT NULL, `created` datetime NOT NULL, `updated` datetime NOT NULL, `order_id` integer NULL REFERENCES `orders_order` (`id`) , `product_id` integer NULL REFERENCES `shop_product` (`id`) , `nmb` integer NOT NULL, `price_per_item` decimal NOT NULL, `total_price` decimal NOT NULL);
CREATE TABLE IF NOT EXISTS `shop_productimg` (`id` integer NOT NULL PRIMARY KEY , `image` varchar(100) NOT NULL, `is_active` bool NOT NULL, `created` datetime NOT NULL, `updated` datetime NOT NULL, `product_id` integer NULL REFERENCES `shop_product` (`id`) , `is_main` bool NOT NULL);
CREATE TABLE IF NOT EXISTS `shop_producttype` (`id` integer NOT NULL PRIMARY KEY , `name` varchar(64) NOT NULL, `is_active` bool NOT NULL);
CREATE TABLE IF NOT EXISTS `shop_product` (`id` integer NOT NULL PRIMARY KEY , `name` varchar(128) NULL, `description` text NULL, `is_active` bool NOT NULL, `created` datetime NOT NULL, `updated` datetime NOT NULL, `price` decimal NOT NULL, `type_id` integer NULL REFERENCES `shop_producttype` (`id`) );
CREATE TABLE IF NOT EXISTS `orders_productinbasket` (`id` integer NOT NULL PRIMARY KEY , `price_per_item` decimal NOT NULL, `total_price` decimal NOT NULL, `is_active` bool NOT NULL, `created` datetime NOT NULL, `updated` datetime NOT NULL, `order_id` integer NULL REFERENCES `orders_order` (`id`), `product_id` integer NULL REFERENCES `shop_product` (`id`), `session_key` varchar(128) NULL, `nmb` integer NOT NULL);
CREATE TABLE IF NOT EXISTS `orders_order` (`id` integer NOT NULL PRIMARY KEY , `customer_name` varchar(128) NULL, `customer_email` varchar(254) NULL, `customer_phone` varchar(48) NULL, `comments` text NULL, `created` datetime NOT NULL, `updated` datetime NOT NULL, `status_id` integer NOT NULL REFERENCES `orders_status` (`id`), `customer_address` varchar(128) NULL, `total_price` decimal NOT NULL, `user_id` integer NULL REFERENCES `auth_user` (`id`) );
